            #region VecArray_Write

            public int VecArray_Write(int MIPI_pair, int slave_add, string _cmd)
            {              
                int ret = 0;
                int Vector_status = 0;
                int vecSetNo = 2;
                int SclkPin = 0;
                int SdataPin = 0;
                int SvioPin = 0;
                MipiPairToPin(MIPI_pair, out SclkPin, out SdataPin, out SvioPin);
                string biasData = _cmd;
                string[] biasDataArr = biasData.Split(new char[] { ' ', '\t' }, StringSplitOptions.RemoveEmptyEntries);//split string with blank space as delimiter
                for (int i = 0; i < biasDataArr.Length; i++)            
                {                   
                    string[] tmpData = biasDataArr[i].Split(':');
                    int RegAddress = Convert.ToInt32(tmpData[0], 16);
                    //if ((RegAddress & 0xE0) > 1)
                    //{ 
                        ExtReg_Write(SclkPin, SdataPin, SvioPin, slave_add, Convert.ToInt32(tmpData[0], 16), Convert.ToInt32(tmpData[1], 16), vecSetNo);
                    //}
                    //else
                    //{
                    //    Reg_Write(SclkPin, SdataPin, SvioPin, slave_add, Convert.ToInt32(tmpData[0], 16), Convert.ToInt32(tmpData[1], 16), vecSetNo);
                    //}
                    double delay = 1 / 52e6;//2->1
                    ret += myDM.ConfigureInputChannelDelay(mipiPair[MIPI_pair].SDATA, delay);//change to 0 from 2
                    ret += myDM.AcquireVecEngineStatus(moduleAlias, out Vector_status);
                    
                    if (Vector_status == 0)
                    {
                        ret += myDM.RunVector(moduleAlias, vecSetNo);
                    }
                }
                if (ret != 0)
                {
                    MessageBox.Show("Ret Error = " + ret.ToString("X"), "DM482e Return Error");
                }
                return ret;
            }
